// Access the Product Title and Description
const productTitle = $node["Edit Fields"].json["Product Title"];
const description = $node["Edit Fields"].json["Description"];

// Extract the advertiser from the description
const advertiserMatch = description.match(/\|Advertiser\|([^\|]+)/);
const advertiser = advertiserMatch ? advertiserMatch[1].trim() : null;

// Ensure the advertiser matches and construct JQL
if (!advertiser) {
  throw new Error("Advertiser not found in the description.");
}

return {
  json: {
    jql: `project = ADO AND type = "Parent" AND summary ~ "${productTitle}" AND customfield_10048 ~ "${advertiser}"`
  },
};

// Collect all comments from connected branches
const comments = items.map(item => item.json.comment || '');

// Combine comments with line breaks
const combinedComment = comments.filter(Boolean).join('\n\n');

// Get the JIRA ticket key from the Edit Fields node using the correct field name
const jiraTicketKey = $items("Edit Fields")[0].json["NOR Ticket Key"];

// Return combined comment and ticket key
return [
  {
    json: {
      combinedComment,
      jiraTicketKey
    }
  }
];

const attachments = $input.all();

let formatCount = 0;
let sizeCount = 0;

attachments.forEach(att => {
  const format = att.json.format?.toUpperCase();
  const width = att.json.size?.width || 0;
  const height = att.json.size?.height || 0;

  // Check format
  if (format === 'JPEG' || format === 'PNG') {
    formatCount++;
  }

  // Check dimensions
  if (width >= 1500 && height >= 1000) {
    sizeCount++;
  }
});

const totalAttachments = attachments.length;

return [
  {
    json: {
      totalAttachments,
      formatCount,
      sizeCount,
      meetsImageRequirement: formatCount >= 1,
      meetsSizeRequirement: sizeCount >= 1
    }
  }
];

const description = $input.first().json.Description;

// Android URL and ID extraction
const androidUrlMatch = description.match(/\|Android URL\|\[([^\|\]]+)/);
const androidUrl = androidUrlMatch ? androidUrlMatch[1] : null;
const androidIdMatch = androidUrl ? androidUrl.match(/id=([^&\]\s]+)/) : null;
const androidId = androidIdMatch ? androidIdMatch[1] : null;

// iOS URL and ID extraction
const iosUrlMatch = description.match(/\|IOS URL\|\[([^\|\]]+)/);
const iosUrl = iosUrlMatch ? iosUrlMatch[1] : null;
const iosIdMatch = iosUrl ? iosUrl.match(/(id\d+)/) : null;
const iosId = iosIdMatch ? iosIdMatch[1] : null;

// Android/iOS/Desktop field extraction
const platformMatch = description.match(/\|Android\/ iOS\/ Desktop\|([^\|]+)/);
const platformValue = platformMatch ? platformMatch[1].trim() : null;

return [
  {
    json: {
      androidUrl,
      androidId,
      iosUrl,
      iosId,
      platformValue
    }
  }
];

// Get fields from the Webhook node
const description = $node["Edit Fields"].json["Description"];
const productTitle = $node["Edit Fields"].json["Product Title"];

// Extract advertiser from description
const advertiserMatch = description.match(/\|Advertiser\|([^\|]+)/);
const advertiser = advertiserMatch ? advertiserMatch[1].trim() : null;

// Trim Product Title to everything before " ("
const trimmedProductTitle = productTitle.split(' (')[0].trim();

// Return both values
return [
  {
    json: {
      advertiser,
      trimmedProductTitle
    }
  }
];

// Get the linked issues array from the node
const linkedIssues = $node["Edit Fields"].json["contained in and relates to"] || [];

// Extract numeric IDs as strings
const ids = linkedIssues.map(issue => `"${issue.id}"`).filter(Boolean);

// Build the final JQL by injecting the IDs into your full query
let jql = "";
if (ids.length > 0) {
  jql = `project = "PRT" AND key IN (${ids.join(", ")})`;
} else {
  jql = `project = "PRT"  AND key IN ()`; // Or adjust to handle empty case
}

// Output
return [
  {
    json: {
      jql
    }
  }
];

const items = $input.all();

// Return only the first item
return [items[0]];

// Get input data (assuming one item)
const input = $input.first().json;

// Extract product title directly from the input
const trimmedProductTitle = input["Product Title"].split(' (')[0].trim();

// Extract advertiser from Description
const description = input["Description"] || "";
const advertiserMatch = description.match(/\|Advertiser\|([^\|]+)\|/);
const advertiser = advertiserMatch ? advertiserMatch[1].trim() : null;

// Extract Integration Type / Platform from Description
const integrationMatch = description.match(/\|Intregration Type \/ Platform \(same as PMMR\)\|([^\|]+)\|/);
const integrationType = integrationMatch ? integrationMatch[1].trim() : null;

return [
  {
    json: {
      trimmedProductTitle,
      advertiser,
      integrationType,
    }
  }
];

const goalGrid = $input.first().json["Goal Grid"];
const tableSections = goalGrid.match(/\| Event Table.*?(?=(\| Event Table|\s*$))/gs);

const result = (tableSections || []).map(section => {
  const lines = section.trim().split('\n').filter(line => line.includes('|'));
  const tableNameMatch = section.match(/\| Event Table\s*(\d+)/i);
  const tableName = tableNameMatch ? `Event Table ${tableNameMatch[1]}` : "Unknown Table";

  const goals = lines
    .filter(line => line.startsWith('|') && !line.includes('goal_for_members||')) // skip header
    .map(line => {
      const columns = line.split('|').map(cell => cell.trim());
      return columns[2]; // index 2 is goal_for_members
    })
    .filter(goal => goal && goal !== 'goal_for_members');

  return {
    table: tableName,
    goals
  };
});

return result.map(entry => ({ json: entry }));

